var a=[{title:"\u5173\u4E8E\u7B80\u5386\u6295\u9012",showQACount:2,isShowQA:!0,list:[{q:"1.\u6821\u62DB\u6B63\u5F0F\u6279\u7684\u62DB\u8058\u5BF9\u8C61\u662F\u54EA\u4E9B\u540C\u5B66\uFF1F",a:"\u672C\u6B21\u6821\u62DB\u9488\u5BF92023\u30012024\u5C4A\u6BD5\u4E1A\u751F\uFF0C\u53732022\u5E749\u6708\u81F32024\u5E748\u6708\u6BD5\u4E1A\u7684\u540C\u5B66\u3002\u4E2D\u56FD\u5927\u9646\u4EE5\u6BD5\u4E1A\u8BC1\u4E3A\u51C6\uFF0C\u975E\u4E2D\u56FD\u5927\u9646\u5730\u533A\u4EE5\u5B66\u4F4D\u8BC1\u4E3A\u51C6\uFF0C\u4E14\u6700\u9AD8\u5B66\u5386\u6BD5\u4E1A\u540E\u65E0\u5168\u804C\u6216\u77ED\u6682\u5DE5\u4F5C\u7ECF\u9A8C\u3002"},{q:"2.\u6821\u62DB\u6B63\u5F0F\u6279\u7684\u6574\u4F53\u65F6\u95F4\u7EBF\u662F\u4EC0\u4E48\u6837\u5462\uFF1F",a:"\u7B80\u5386\u6295\u9012 \uFF1A9-12\u6708\u6301\u7EED\u5F00\u653E\uFF1B       \u6D4B\u8BC4\uFF1A\u6295\u9012\u540E\u81EA\u52A8\u89E6\u53D1\uFF1B      \u9762\u8BD5\uFF1A9\u6708\u5E95-12\u6708\u5E95\uFF1B        Offer\u53D1\u653E\uFF1A10-12\u6708"},{q:"3.\u6BCF\u4EBA\u6BCF\u6B21\u53EF\u4EE5\u6295\u9012\u51E0\u4E2A\u5C97\u4F4D\u5462\uFF1F",a:"\u6BCF\u4EBA\u6700\u591A\u53EF\u586B\u62A52\u4E2A\u5C97\u4F4D\u5FD7\u613F\u3002\u672C\u6B21\u6B63\u5F0F\u6279\u4E00\u4E2A\u540C\u5B66\u53EF\u4EE5\u6295\u9012\u4E24\u4E2A\u5C97\u4F4D\u3002 \u5982\u679C\u4F60\u6295\u9012\u7684\u804C\u4F4D\u672A\u88AB\u5F55\u7528\uFF0CHR \u6709\u53EF\u80FD\u4F1A\u6839\u636E\u4F60\u7684\u7B80\u5386\u60C5\u51B5\uFF0C\u518D\u6B21\u9080\u8BF7\u4F60\u8FDB\u5165\u6821\u62DB\u6D41\u7A0B\u3002\u4F60\u7684\u7533\u8BF7\u804C\u4F4D\u53CA\u62DB\u8058\u8FDB\u5EA6\u4F1A\u968F\u4E4B\u66F4\u65B0\uFF0C\u8BF7\u7559\u610F\u76F8\u5173\u90AE\u4EF6\u53CA\u77ED\u4FE1\u901A\u77E5\uFF1B"},{q:"4.\u62DB\u8058\u5BF9\u5B66\u5386\u548C\u6240\u5B66\u4E13\u4E1A\u6709\u9650\u5236\u5417\uFF1F",a:"wenext\u662F\u4E00\u5BB6\u667A\u80FD\u5236\u9020\u516C\u53F8\uFF0C\u5BF9\u7BA1\u57F9\u751F\u65E0\u7EDD\u5BF9\u7684\u4E13\u4E1A\u8981\u6C42\uFF0C\u7406\u5DE5\u79D1\u80CC\u666F\u4F18\u5148\u3002\u4E0D\u540C\u7684\u804C\u4F4D\u5BF9\u4EBA\u624D\u7684\u9700\u6C42\u4F1A\u6709\u6240\u4E0D\u540C\uFF0C\u6709\u5173\u5B66\u5386\u548C\u4E13\u4E1A\u7684\u8981\u6C42\u90FD\u4F1A\u5728\u5177\u4F53\u7684\u804C\u4F4D\u63CF\u8FF0\u4E2D\u5448\u73B0\u3002"},{q:"5.\u5982\u679C\u5DF2\u7ECF\u6295\u9012\u4E86\u65E5\u5E38\u5B9E\u4E60\u6216\u793E\u62DB\u804C\u4F4D\uFF0C\u8FD8\u53EF\u4EE5\u6295\u9012\u6821\u62DB\u804C\u4F4D\u5417\uFF1F",a:"\u53EF\u4EE5\u3002\u4E4B\u524D\u6295\u9012\u7684\u5C97\u4F4D\u5728\u8FDB\u5EA6\u4E2D\u53EF\u80FD\u8FD8\u4F1A\u67E5\u8BE2\u5230\uFF0C\u5E76\u51FA\u73B0\u6392\u5728\u6821\u62DB\u5FD7\u613F\u4E4B\u524D\u7684\u60C5\u51B5\u3002"},{q:"6.\u804C\u4F4D\u6295\u9012\u6210\u529F\u540E\uFF0C\u8FD8\u53EF\u4EE5\u4FEE\u6539\u6295\u9012\u804C\u4F4D\u6216\u8C03\u6574\u5FD7\u613F\u987A\u5E8F\u5417\uFF1F",a:"\u5E73\u884C\u5FD7\u613F\u539F\u5219\uFF0C\u7B80\u5386\u7B5B\u9009\u4E0D\u53C2\u8003\u5019\u9009\u4EBA\u5FD7\u613F\u987A\u5E8F\uFF0C\u540C\u65F6\u6295\u9012\u540E\u4E5F\u65E0\u6CD5\u8C03\u6574\u5FD7\u613F\u987A\u5E8F\u3002"},{q:"7.\u5982\u4F55\u77E5\u9053\u6211\u7684\u62DB\u8058\u8FDB\u5C55\uFF1F",a:"\u5173\u6CE8\u3010\u672A\u6765\u5DE5\u573A\u62DB\u8058\u3011-\u83DC\u5355\u680F\u9009\u62E9\u3010\u6821\u56ED\u62DB\u8058\u3011-\u3010\u8FDB\u5EA6\u67E5\u8BE2\u3011\u5373\u53EF\u67E5\u8BE2\u7B80\u5386\u5B9E\u65F6\u8FDB\u5C55\u3002"},{q:"8.\u5982\u679C\u7B80\u5386\u72B6\u6001\u5DF2\u7ECF\u505C\u7559\u5728\u67D0\u4E00\u4E2A\u9636\u6BB5\u5F88\u4E45\u4E86\uFF08\u8D85\u8FC7 10 \u4E2A\u5DE5\u4F5C\u65E5\uFF09\uFF0C\u8BF4\u660E\u6D41\u7A0B\u5DF2\u7ECF\u7ED3\u675F\u4E86\u5417\uFF1F",a:"\u5982\u6D41\u7A0B\u7ED3\u675F\uFF0C\u8FDB\u5C55\u67E5\u8BE2\u4E2D\u4F1A\u663E\u793A\u3010\u6682\u4E0D\u5408\u9002\u3011\uFF0C\u5982\u4ECD\u5728\u6D41\u7A0B\u8BF4\u660E\u7B80\u5386\u5C1A\u5728\u8BC4\u4F30\u3002"},{q:"9.\u5B9E\u4E60\u751F\u5C97\u4F4D\u7684\u62DB\u8058\u5BF9\u8C61\uFF1F",a:"\u76EE\u524D\u6211\u4EEC\u7684\u5B9E\u4E60\u751F\u5C97\u4F4D\u63A5\u53D7\u5927\u4E09\u53CA\u4EE5\u4E0A\u5E74\u7EA7\u7684\u5728\u6821\u751F\u7B80\u5386\u3002"}]},{title:"\u5173\u4E8E\u7B14\u8BD5",showQACount:2,isShowQA:!0,list:[{q:"1.\u6B63\u5F0F\u6279\u6295\u9012\u901A\u9053\u4E2D\u6240\u6709\u804C\u4F4D\u90FD\u4F1A\u5B89\u6392\u6D4B\u8BC4\u6216\u7B14\u8BD5\u5417\uFF1F",a:"\u4E0D\u662F\u7684\uFF0C\u6211\u4EEC\u4F1A\u6839\u636E\u804C\u4F4D\u7C7B\u578B\u51B3\u5B9A\u5019\u9009\u4EBA\u8FDB\u5165\u7B14\u8BD5\u6216\u6D4B\u8BC4\u9636\u6BB5\uFF0C\u8BF7\u5927\u5BB6\u6CE8\u610F\u67E5\u6536\u90AE\u7BB1\u3002"},{q:"2.\u7B14\u8BD5\u91C7\u53D6\u4EC0\u4E48\u5F62\u5F0F\uFF1F\u662F\u4EC0\u4E48\u65F6\u5019\uFF1F",a:"\u91C7\u53D6\u5728\u7EBF\u7B14\u8BD5\u7684\u5F62\u5F0F\uFF0C\u7B14\u8BD5\u524D\u4F1A\u53D1\u9001\u7B14\u8BD5\u9080\u8BF7\uFF0C\u8BF7\u8010\u5FC3\u7B49\u5F85\u90AE\u4EF6\u548C\u77ED\u4FE1\u901A\u77E5\u3002"},{q:"3.\u9519\u8FC7\u6B64\u6B21\u7B14\u8BD5\uFF0C\u8FD8\u80FD\u518D\u53C2\u52A0\u7B14\u8BD5\u5417\uFF1F",a:"\u5EFA\u8BAE\u5927\u5BB6\u6536\u5230\u7B14\u8BD5\u901A\u77E5\u540E\uFF0C\u5C3D\u91CF\u6309\u65F6\u53C2\u52A0\u3002\u5982\u56E0\u7279\u6B8A\u539F\u56E0\u65E0\u6CD5\u53C2\u52A0\uFF0C\u8BF7\u5728\u3010\u672A\u6765\u5DE5\u573A\u62DB\u8058\u3011\u516C\u4F17\u53F7\u540E\u53F0\u7559\u8A00\u8BF4\u660E\u3002\u6211\u4EEC\u5C06\u4F1A\u5728\u540E\u7EED\u7B14\u8BD5\u53D1\u653E\u65E5\u89E6\u53D1\u65B0\u7684\u7B14\u8BD5\u901A\u77E5\uFF0C\u6536\u5230\u901A\u77E5\u768448h\u5185\u9700\u8981\u5B8C\u6210\u4F5C\u7B54\uFF0C\u8BF7\u8010\u5FC3\u7B49\u5F85\u90AE\u4EF6\u548C\u77ED\u4FE1\u901A\u77E5\u3002  * \u540C\u4E00\u4E2A\u804C\u4F4D\uFF0C\u7B14\u8BD5\u9080\u8BF7\u4E24\u6B21\u5747\u672A\u4F5C\u7B54\u8005\uFF0C\u5C06\u6CA1\u6709\u673A\u4F1A\u53C2\u4E0E\u8BE5\u804C\u4F4D\u540E\u7EED\u7B14\u8BD5\u3002"},{q:"4. \u6211\u6536\u5230\u4E86\u591A\u4E2A\u6D4B\u8BC4\uFF0C\u90FD\u9700\u8981\u53C2\u52A0\u5417\uFF1F",a:"\u6536\u5230\u591A\u6B21\u6D4B\u8BC4\u65F6\uFF0C\u53EA\u9700\u8981\u505A\u4E00\u6B21\u5373\u53EF\u3002\u5F53\u7B2C\u4E8C\u6B21\u6536\u5230\u6D4B\u8BC4\u94FE\u63A5\u65F6\uFF0C\u5355\u51FB\u6D4B\u8BC4\u94FE\u63A5\uFF0C\u586B\u5199\u6B63\u786E\u7684\u4FE1\u606F\uFF0C\u53EF\u4EE5\u9009\u62E9\u590D\u7528\u7B2C\u4E00\u6B21\u6D4B\u8BC4\u7ED3\u679C\u6216\u518D\u505A\u4E00\u6B21\u3002"},{q:"5.\u6211\u6536\u5230\u4E86\u591A\u4E2A\u7B14\u8BD5\uFF0C\u90FD\u9700\u8981\u53C2\u52A0\u5417\uFF1F",a:"\u662F\u7684\uFF0C\u7B14\u8BD5\u5185\u5BB9\u4F1A\u6839\u636E\u6295\u9012\u5C97\u4F4D\u6709\u6240\u533A\u522B\uFF0C\u9700\u8981\u5B8C\u6210\u5BF9\u5E94\u5C97\u4F4D\u7684\u7B14\u8BD5\u3002"},{q:"6.\u6D4B\u9891\u6216\u7B14\u8BD5\u4E4B\u540E\uFF0C\u4E3A\u4EC0\u4E48\u7B80\u5386\u72B6\u6001\u4E00\u76F4\u4E3A\u3010\u7B14\u8BD5\u4E2D\u3011\uFF1F",a:"\u6D4B\u8BC4\u548C\u7B14\u8BD5\u90FD\u5C5E\u4E8E\u201C\u7B14\u8BD5\u4E2D\u201D\u8FDB\u5EA6\uFF0C\u6211\u4EEC\u6B63\u5728\u5BF9\u6D4B\u8BC4\u7B14\u8BD5\u7ED3\u679C\u8FDB\u884C\u8BC4\u4F30\uFF0C\u8BF7\u8010\u5FC3\u7B49\u5F85\u6D4B\u8BC4\u6216\u7B14\u8BD5\u7ED3\u679C\u3002"},{q:"7.\u5982\u4F55\u67E5\u8BE2\u5230\u6D4B\u8BC4\u6216\u7B14\u8BD5\u6210\u7EE9\uFF1F",a:"\u6682\u65F6\u65E0\u6CD5\u67E5\u8BE2\uFF0C\u6D4B\u8BC4\u548C\u7B14\u8BD5\u6CA1\u6709\u8BBE\u7F6E\u5177\u4F53\u7684\u53CA\u683C\u7EBF\uFF0C\u662F\u9762\u8BD5\u5B98\u662F\u5426\u53D1\u8D77\u9762\u8BD5\u7684\u91CD\u8981\u53C2\u8003\u3002"}]},{title:"\u5173\u4E8E\u9762\u8BD5",showQACount:2,isShowQA:!0,list:[{q:"1.\u9762\u8BD5\u5F62\u5F0F\u662F\u600E\u6837\u7684\uFF1F",a:"\u9762\u8BD5\u5C06\u91C7\u7528\u4E3B\u8981\u4E3A\u7EBF\u4E0A\u817E\u8BAF\u4F1A\u8BAE\u9762\u8BD5\uFF0C\u6821\u62DB\u7EC4\u5C06\u89C6\u5404\u57CE\u5E02\u7B80\u5386\u6295\u9012\u60C5\u51B5\u5F00\u5C55\u7EBF\u4E0B\u9762\u8BD5\u5DE5\u4F5C\uFF1B"},{q:"2.\u4E3A\u4EC0\u4E48\u6211\u6536\u4E0D\u5230\u4EFB\u4F55\u9762\u8BD5\u4FE1\u606F\uFF1F",a:"\u5728\u6295\u9012\u7B80\u5386\u65F6\u52A1\u5FC5\u4FDD\u8BC1\u624B\u673A\u53F7\u3001\u90AE\u7BB1\u7684\u6B63\u786E\u4E0E\u6709\u6548\u6027\uFF0C\u4EE5\u4FBF\u60A8\u6210\u529F\u63A5\u6536\u9762\u8BD5\u4FE1\u606F\uFF0C\u6B63\u5E38\u60C5\u51B5\u4E0B\u6211\u4EEC\u4F1A\u5728\u6BCF\u4E2A\u73AF\u8282\u63D0\u524D1-2\u5929\u4E0E\u60A8\u6715\u7CFB\u3002"},{q:"3.\u4E00\u5171\u6709\u51E0\u8F6E\u9762\u8BD5\u5462\uFF1F",a:"\u300CX-Lab\u300D\u7BA1\u57F9\u751F\u9762\u8BD5\u4E00\u5171\u4E24\u8F6E\uFF0C\u5206\u522B\u662F\u7EFC\u5408\u9762\u53CABOSS\u9762\uFF0C\u5747\u4E3A\u5355\u9762\uFF1B"},{q:"4.\u9762\u8BD5\u540E\u591A\u957F\u65F6\u95F4\u53EF\u4EE5\u6536\u5230\u7ED3\u679C\uFF1F",a:"\u5173\u6CE8\u3010\u672A\u6765\u5DE5\u573A\u62DB\u8058\u3011\u516C\u4F17\u53F7\uFF0C\u83DC\u5355\u680F\u3010\u6821\u56ED\u62DB\u8058\u3011-\u3010\u67E5\u770B\u8FDB\u5EA6\u3011\u53EF\u5B9E\u65F6\u67E5\u770B\u62DB\u8058\u8FDB\u5C55\u3002"}]}];export{a as f};
